import cv2
import base64
import torch
from yolov5tracker.tracker import *
import numpy as np
from PIL import Image

path = r"E:\yolov5\yolov5"
model = torch.hub.load(path, 'yolov5n', pretrained=True, source='local')
model.classes = 0

# Example base64 encoded image data
base64_data = "data:image/jpeg;base64,"
#img_data = base64_data.split(",")[1]

#img_bytes = base64.b64decode(img_data)
#img_arr = np.frombuffer(img_bytes, dtype=np.uint8)
#img = cv2.imdecode(img_arr, cv2.IMREAD_COLOR)

#Example raw image data from robot
f = open('rgbImage.txt', 'r')
image_string = f.read()
image_string=image_string.replace(',',' ')
image_string=image_string.replace('[','')
image_string=image_string.replace(']','')


# Convert the string to a list of floats
image_list = [float(x) for x in image_string.split()]

# Convert the list of floats to a NumPy array
image_array = np.array(image_list)
#image_array = image_array[0:921600]

# Reshape the NumPy array to the desired shape
image_array = image_array.reshape(480, 640, 3)

cap = cv2.VideoCapture(0)

cv2.namedWindow('FRAME')

tracker = Tracker()

area_1a = [(0, 0), (90, 0), (90, 480), (0, 480)]
area_1b = [(90, 0), (230, 0), (230, 480), (90, 480)]
area_2a = [(550, 0), (640, 0), (640, 480), (550, 480)]
area_2b = [(420, 0), (550, 0), (550, 480), (420, 480)]

while True:
    ret, frame = cap.read()
    frame=cv2.resize(frame,(640,480))
    ##cv2.polylines(frame,[np.array(area_1a,np.int32)],True,(0,0,255),3)
    #cv2.polylines(frame,[np.array(area_2a, np.int32)], True, (0, 0, 255), 3)
    #cv2.polylines(frame,[np.array(area_1b,np.int32)],True,(0,255,0),3)
    #cv2.polylines(frame,[np.array(area_2b, np.int32)], True, (0, 255, 0), 3)

    # Process the frame here...
    results = model(frame)
    # frame=np.squeeze(results.render())
    list = []
    for index, row in results.pandas().xyxy[0].iterrows():
        x1 = int(row['xmin'])
        y1 = int(row['ymin'])
        x2 = int(row['xmax'])
        y2 = int(row['ymax'])
        b = str(row['name'])
        if 'person' in b:
            list.append([x1, y1, x2, y2])
        xcen = int((x1 + x2) / 2)
        ycen = int((y1 + y2) / 2)
        cv2.putText(frame, '+', (xcen, ycen), cv2.FONT_HERSHEY_DUPLEX, 0.5, (186, 226, 65), 1)

    boxes_ids = tracker.update(list)
    ids = []
    for box_id in boxes_ids:
        x, y, w, h, id = box_id
        ids.append(id)
    if ids:
        sortId = sorted(ids)
    for box_id in boxes_ids:
        x, y, w, h, id = box_id
        cv2.rectangle(frame, (x, y), (w, h), (51, 231, 247), 3)
        if id == sortId[0]:
            # print(id)
            xTrack = int((x + w) / 2)
            yTrack = int((y + h) / 2)
            cv2.putText(frame, str('FOLLOWING'), (x, y + 30), cv2.FONT_HERSHEY_DUPLEX, 0.8, (64, 214, 119), 2)
            result2a = cv2.pointPolygonTest(np.array(area_2a, np.int32), (int(xTrack), int(yTrack)), False)
            result1a = cv2.pointPolygonTest(np.array(area_1a, np.int32), (int(xTrack), int(yTrack)), False)
            result2b = cv2.pointPolygonTest(np.array(area_2b, np.int32), (int(xTrack), int(yTrack)), False)
            result1b = cv2.pointPolygonTest(np.array(area_1b, np.int32), (int(xTrack), int(yTrack)), False)

            # result: 0 - center, 1 - HARD LEFT, 2 - HARD RIGHT, 3 - turn left, 4 - turn right
            if result1a == 1:
                result = 'hard left'
            elif result2a == 1:
                result = 'hard right'
            elif result1b == 1:
                result = 'left'
            elif result2b == 1:
                result = 'right'
            else:
                result = 'center'
            print(result)
        elif id == sortId[1]:
            cv2.putText(frame, str('NEXT'), (x, y + 30), cv2.FONT_HERSHEY_DUPLEX, 0.8, (250, 241, 72), 2)
        else:
            cv2.putText(frame, str('NOT FOLLOWED'), (x, y + 30), cv2.FONT_HERSHEY_DUPLEX, 0.8, (250, 84, 72), 2)
    cv2.imshow('FRAME', frame)

    if cv2.waitKey(1)&0xFF==27:
        break
cap.release()
cv2.destroyAllWindows()